import { StyleSheet, Text, View, TouchableOpacity } from "react-native";
import React from "react";

const YouPage = () => {
  return (
    <View>
      <View>
        <TouchableOpacity style={styles.uploadBtn}>
          <Text
            style={{
              textAlign: "center",
              fontSize: 16,
              opacity: 0.5,
              fontWeight: "bold",
            }}
          >
            Upload Profile Image
          </Text>
        </TouchableOpacity>
        <Text>Skip</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({});

export default YouPage;
